const CreateNFT = (props) => {
    const {
        minting,
        pdfName,
        setActivePdfModal,
        setPdfUrl,
        setPdfName,
        setTitle,
        setPageLimit,
        setAuthor,
        setDescription,
        imageName,
        setImageName,
        setGenre,
        setLanguage,
        setQty,
        setLicense,
        setFee,
        setMintAmount,
        listToMarketChecked,
        setListToMarket,
        onPdfChange,
        onImageChange,
        create
    } = props
    return (
        <div className={styles.div}>
            <div className="d_flex justify_content_between align_items_center">
                <div className="h6">My book</div>
                <Button value="Preview" style={{ width: 106, height: 32 }}
                    disabled={pdfName === 'No file choosen'}
                    onClick={e => setActivePdfModal(true)} red />
            </div>
            <form>
                <div className={styles.row}>
                    <div className="caption grey60"> Pdf file </div>
                    <input
                        type="file"
                        onChange={(e) => {
                            onPdfChange(e.target.files[0])
                            setPdfName(e.target.files[0].name)
                            setPdfUrl(URL.createObjectURL(e.target.files[0]))
                        }}
                        accept="application/pdf"
                        id="pdf"
                        autoComplete="off"
                        hidden
                    />
                    <div className="d_flex align_items_center">
                        <label htmlFor="pdf" className={styles.btnFile}>
                            Select
                        </label>
                        <span className="body_1 ml_10">{pdfName}</span>
                    </div>
                </div>
                <div className="caption grey60 mt_5 ml_10">
                    The first page should be your book cover.
                </div>
                <div className={styles.row}>
                    <div className="caption grey60"> Book title </div>
                    <input
                        type="text"
                        onChange={(e) => setTitle(e.target.value)}
                        id="title"
                        name="title"
                        required
                        autoComplete="off"
                    />
                </div>
                <div className={styles.row}>
                    <div className="caption grey60"> Author(s) </div>
                    <input
                        type="text"
                        onChange={(e) => setAuthor(e.target.value)}
                        required
                        id="author"
                        name="author"
                        autoComplete="off"
                    />
                </div>
                <div className="caption grey60 mt_5 ml_10"> Separate by comma </div>
                <div className={styles.row}>
                    <div className="caption grey60"> Description </div>
                    <textarea
                        type="text"
                        onChange={(e) => setDescription(e.target.value)}
                        id="description"
                        name="description"
                        required
                        autoComplete="off"
                    />
                </div>
                <div className="h6 mt_25">Image</div>
                <div className="caption grey60 mt_8">Recommend 1224 x 1584 pixel, Letter size</div>
                <div className={styles.row_group}>
                    <div className={styles.row}>
                        <div className="caption grey60"> Book cover image </div>
                        <input
                            type="file"
                            onChange={(e) => {
                                setImageName(e.target.files[0].name)
                                onImageChange(e.target.files[0])
                            }}
                            accept="image/*"
                            id="image"
                            hidden
                            autoComplete="off"
                        />
                        <div className="d_flex align_items_center">
                            <label htmlFor="image" className={styles.btnFile}>
                                Select
                            </label>
                            <span className="body_1 ml_10">{imageName}</span>
                        </div>
                    </div>
                    <div className={styles.row}>
                        <div className="caption grey60"> Preview Page Limit </div>
                        <input
                            type="text"
                            onChange={(e) => setPageLimit(e.target.value)}
                            id="title"
                            name="title"
                            required
                            autoComplete="off"
                        />
                    </div>
                </div>

                <div className="h6 mt_25">Metadata</div>
                <div className={styles.row}>
                    <div className="caption grey60"> Genre </div>
                    <MultiSelectComponent
                        id="genre"
                        name="genre"
                        dataSource={genreData}
                        mode="Delimiter"
                        fields={fields}
                        change={e => setGenre(e.value)} />
                </div>
                <div className={styles.row_group}>
                    <div className={styles.row}>
                        <div className="caption grey60"> Language </div>
                        <DropDownListComponent
                            id="language"
                            name="language"
                            dataSource={languageData}
                            fields={fields} popupHeight="auto"
                            change={e => setLanguage(e.value)} />
                    </div>
                    <div className={styles.row}>
                        <div className="caption grey60"> Max Quantity (max. 10000) </div>
                        <input
                            type="number"
                            onChange={(e) => setQty(e.target.value)}
                            id="qty"
                            name="qty"
                            required
                            autoComplete="off"
                        />
                    </div>
                </div>
                <div className={styles.row}>
                        <div className="caption grey60"> Licensing Info </div>
                        <input
                            type="text"
                            onChange={(e) => setLicense(e.target.value)}
                            id="license"
                            name="license"
                            autoComplete="off"
                        />
                    </div>
                <div className="h6 mt_25">Token Issuance</div>
                <div className={styles.row_group}>
                    <div className={styles.row}>
                        <div className="caption grey60"> Number of tokens to premint to creator </div>
                        <input
                            type="number"
                            onChange={(e) => setMintAmount(e.target.value)}
                            id="qty"
                            name="qty"
                            required
                            autoComplete="off"
                            placeholder="1"
                            min="1"
                            defaultValue="1"
                        />
                    </div>
                    <div className={styles.row}>
                        <div className="caption grey60"> Cost to Mint (Eth)</div>
                        <input
                                type="number"
                                onChange={(e) => setFee(e.target.value)}
                                id="qty"
                                name="qty"
                                required
                                autoComplete="off"
                                placeholder="0.01"
                                step="0.005"
                                defaultValue="0.01"
                            />
                    </div>
                </div>
                <div className={styles.row}>
                    <div className="caption grey60"> Marketplace options </div>
                    <input className="checkbox"
                        type="checkbox" 
                        checked={listToMarketChecked} 
                        onChange={(e) => setListToMarket(e.target.value)}
                    /><span className="caption">List premint supply directly on Marketplace for mint price</span>
                </div>
                <Button value="Create" redBg onClick={create} disabled={minting}
                    style={{ width: '100%', height: 56, marginTop: 25 }} />
            </form>
        </div>
    )
}

export default CreateNFT
